        return new Source("{% extends 'base.html.twig' %}

{% block title %}Register{% endblock %}

{% block body %}
    {% for label, messages in app.flashes %}
        {% for message in messages %}
            <div class=\"alert alert-{{ label }} alert-dismissible fade show\" role=\"alert\">
                {{ message }}
                <button type=\"button\" class=\"close\" data-dismiss=\"alert\" aria-label=\"Close\">
                     <span aria-hidden=\"true\">×</span>
                </button>
             </div>
        {% endfor %}
    {% endfor %}
    <div class=\"container\" style=\"background: navajowhite;border: 0;\">
        <div class=\"row\" style=\"background: navajowhite;\">
            <div class=\"bg-light mt-4 p-4\" style=\"background: navajowhite;margin-left: 50px;\">
                <h1>Register</h1>

                 {{ form_start(registrationForm) }}
                    {{ form_row(registrationForm.name, {
                        label: 'Name'
                    }) }}
                    {{ form_row(registrationForm.email) }}
                    {{ form_row(registrationForm.plainPassword, {
                        label: 'Password'
                    }) }}
                   
                    {{ form_row(registrationForm.agreeTerms) }}

                    <button type=\"submit\" class=\"btn btn-primary\">Register</button>
                {{ form_end(registrationForm) }}
            </div>
        </div>
    </div>
{% endblock %}
", "registration/register.html.twig", "/var/www/soniapaezromerostoreonline.live/StoreProjectSoniaPaez/templates/registration/register.html.twig");
